import axios from 'axios'

const UserBlogs = () => {
    const [blogs , setBlogs]=useState([])

    const getUserBlog = async()=>{
        try {
            const id = localStorage.getItem('userId')
            const {data}=await axios.get(`http://localhost:8081/api/blogs/get-blog/${id}`)
